namespace LeetCodes.Tests;

using Xunit;

public class Leet567Tests
{
    private static readonly Leet567 Leet = new Leet567();

    [Theory]
    [MemberData(nameof(TestData))]
    public void Test(int caseNo, string s1, string s2, bool expected)
    {
        var actual = Leet.CheckInclusion(s1, s2);
        Assert.True(expected == actual, $"caseNo: {caseNo}, expected: {expected}, actual: {actual}");
    }

    [Fact]
    public void LargeInputs()
    {
        var actual = Leet.CheckInclusion(S1, S2);
        Assert.True(actual);
    }

    public static IEnumerable<object[]> TestData()
    {
        foreach (var (caseNo, s1, s2, expected) in Leet567.Data)
        {
            yield return new object[] { caseNo, s1, s2, expected };
        }
    }

    private const string S1 = @"";
    private const string S2 = @"";
}
